import React from 'react';
import '../App.css';
import './Journey.css';


const Journey = () => {
    return(
        <section className="journey__main">
            <div className="journey__container">
                <div className="journey__wrapper">
                    <div className="journey__ Title">
                        We're your AI guide<br/>Just Click and start your Journey
                    </div>
                    <p className="title__explain">You want to go Japan? but you can't read or speak Japanese Language.<br/>
                    chatGPT's brother will serve your plan.</p>
                </div>
            </div>
        </section>
    )
}

export default Journey;
